export const REVIEWS_ACTIONS = {
  loadReview: 'review/loadingReview',
  startLoading: 'review/startLoading',
  successLoading: 'review/successLoading',
  failLoading: 'review/failLoading',
}

export const loadReview = (restaurantId) => ({
  type: REVIEWS_ACTIONS.loadReview,
  payload: restaurantId,
})

export const startLoading = () => ({
  type: REVIEWS_ACTIONS.startLoading,
})

export const successLoading = (normalazideReview) => ({
  type: REVIEWS_ACTIONS.successLoading,
  payload: normalazideReview,
})

export const falidLoading = () => ({
  type: REVIEWS_ACTIONS.failLoading,
})
